decoNote.p:
The remaining miniatures are portraits of the four Evangelists painted in a realistic style:
                                        59r: John;
                                        60v: Luke;
                                        62v: Matthew;
                                        63v: Mark.
                                        The miniatures are composed as a frame in a frame, with an outer decorative border not related to the story in the illustration and an inner frame usually shaped as a window or portal. The borders are also used for pages with large intitials, e.g. 7r. The majority of the borders feature realistically painted flowers, birds, and insects usually placed on a yellow background, e.g. 60v. The other dominating motif for the borders is architectural elements, e.g. 11r and 62r. All other leaves feature a quarter-border in the outer margin. These are usually similar in style to the full borders, but with variation, e.g. 119v and 40v. 
                                        There are also borders containing text, which often appear to be either heavily abbreviated or garbled, e.g. 79r. 
                                        2r: Christ carrying the cross (monochrome in the border)
                                        3r: man kneeling infront of three angels (monochrome in the border)
                                        22r, 140r: historiated?

2r-139r: Chapters are usually opened by foliate initials over 6 lines. The letters are usually painted in blue with white highlights and the conterspace filled with red with gold highlights. The letters are placed on a gold background outlined in black. On 3r, 35r, 49r, and 129 the initials are over 5 lines with letters painted in yellowish brown with details in gold/yellow; background in purplish blue or red, both with gold highlights. 
                                        2r-165r: Paragraphs are opened by decorated initials over 2 lines. The letters are painted in blue with white details and placed on background in red with gold details. Sentences are opened by similar intials over 1 line. 
                                        The minor offices on 36r-46v feature historiated initials over 4-6 lines. The intials are painted in purple or yellow, both with gold highlights and are placed on a background of yellow and gold, or purple and gold. The motifs in the counterspaces are painted in shades of yellowish brown against a blue background. 
                                        Motifs:
                                        36r: Nativity;
                                        39r: Trinity;
                                        41r: Coronation of the Virign;
                                        43r: priest with monstrance;
                                        45r: Crucifixion;
                                        46v: burial.
